import { useState } from 'react';
import { NavLink as RRNavLink, useNavigate } from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Dropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Input,
    InputGroup,
    InputGroupText
} from 'reactstrap';
import {
    Search,
    SortAlphaDown,
    Flower3,
    Grid,
    Book,
    Gift,
    Cup,
    Cookie,
    Palette,
    ColumnsGap,
    GlobeAsiaAustralia
} from 'react-bootstrap-icons';

import Logo from '../assets/logo/cheese-logo.png';

function NavBar(args) {
    const [isOpen, setIsOpen] = useState(false);
    const [dropdownOpen, setDropdownOpen] = useState(false);
    const [searchQuery, setSearchQuery] = useState('');
    const navigate = useNavigate();

    const toggleNavbar = () => setIsOpen(!isOpen);
    const toggleDropdown = () => setDropdownOpen(prevState => !prevState);

    const hoverStyle = {
        color: 'black',
    };

    // Handle search query submission
    const handleSearch = (e) => {
        e.preventDefault();
        if (searchQuery) {
            navigate(`/search?q=${searchQuery}`);
        }
    };

    return (
        <div>
            <Navbar {...args}>
                <NavbarBrand to="/" tag={RRNavLink}>
                    <img src={Logo} alt="logo" className="rounded" width="30" height="30" />
                    PZ Cheeseria
                </NavbarBrand>
                <NavbarToggler onClick={toggleNavbar} />

                <Collapse isOpen={isOpen} navbar>
                    <Nav className="me-auto" navbar>
                        {/* Alphabetical */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/alphabetical">
                                <SortAlphaDown className="m-1" size={20} />  {/* Alphabetical icon */}
                                Alphabetical
                            </NavLink>
                        </NavItem>

                        {/* Cheeses by Category (Dropdown) */}
                        <Dropdown nav inNavbar isOpen={dropdownOpen} toggle={toggleDropdown}>
                            <DropdownToggle nav caret className="link-light bg-dark"> 
                                <Grid className="m-1" size={20} />  {/* Category icon */}
                                Cheeses by Category
                            </DropdownToggle>
                            <DropdownMenu className="bg-dark">  {/* Dark background for dropdown menu */}
                                <DropdownItem tag={RRNavLink} to="/category/type" className="text-light" style={{ ':hover': hoverStyle }}>
                                    <ColumnsGap className="m-1" size={20} />  {/* Type icon */}
                                    Cheese By Type
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/country" className="text-light" style={{ ':hover': hoverStyle }}>
                                    <GlobeAsiaAustralia className="m-1" size={20} />  {/* Country icon */}
                                    Cheese By Country
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/milk" className="text-light" style={{ ':hover': hoverStyle }}>
                                    <Cup className="m-1" size={20} />  {/* Milk icon */}
                                    Cheese By Milk
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/texture" className="text-light" style={{ ':hover': hoverStyle }}>
                                    <Cookie className="m-1" size={20} />  {/* Texture icon */}
                                    Cheese By Texture
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/colour" className="text-light" style={{ ':hover': hoverStyle }}>
                                    <Palette className="m-1" size={20} />  {/* Color icon */}
                                    Cheese By Colour
                                </DropdownItem>
                            </DropdownMenu>
                        </Dropdown>

                        {/* Vegetarian Cheeses */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/vegetarian">
                                <Flower3 className="m-1" size={20} />  {/* Vegetarian icon */}
                                Vegetarian Cheeses
                            </NavLink>
                        </NavItem>

                        {/* Cheese Recipes */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/recipes">
                                <Book className="m-1" size={20} />  {/* Recipes icon */}
                                Cheese Recipes
                            </NavLink>
                        </NavItem>

                        {/* Cheese Gifts */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/gifts">
                                <Gift className="m-1" size={20} />  {/* Gifts icon */}
                                Cheese Gifts
                            </NavLink>
                        </NavItem>
                    </Nav>

                    {/* Search bar */}
                    <form onSubmit={handleSearch} className="d-flex">
                        <InputGroup>
                            <Input
                                type="search"
                                value={searchQuery}
                                onChange={(e) => setSearchQuery(e.target.value)}
                                placeholder="Search Cheeses..."
                            />
                            <InputGroupText onClick={handleSearch} style={{ cursor: 'pointer' }}>
                                <Search />  {/* Search icon */}
                            </InputGroupText>
                        </InputGroup>
                    </form>
                </Collapse>
            </Navbar>
        </div>
    );
}

export default NavBar;
